import React from 'react'
import './phone-item.css'

export const PhoneItem = (game) => {
  return (
    <div className='phone-item'>
      <div className='phone-item-details'>
        <span className='phone-item-title'>{ game.title }</span>
        <div className='phone-item-buy'>Buy</div>
      </div>
    </div>
  )
}
